        </m-button>
        <m-image :borderRadius="10" :mode="['aspectFit', 'scaleToFill', 'aspectFill', 'widthFix', 'heightFix'][3]"
                 :shape="['square', 'circle'][0]" :showLoading="false" :src="baseConfig.cheatsImg"
                 bgColor="rgba(0, 0, 0, 1)"
                 bgColorError="rgba(0, 0, 0, 1)" duration="0" height="408">
