            :disabled="false" :hairLine="true" :loading="false" :plain="false"
            :ripple="true" :shape="['square', 'circle'][1]"
            :size="['default', 'medium', 'mini'][1]" :type="['default', 'primary', 'error', 'warning', 'success'][1]"
            class="text-white"
            open-type="share">
            分享
        </m-button>

        <m-modal :closeShow="false" :closeSize="40" :descSize="30" :maskClosable="true" :showContent="false"
                 :showTitle="false"
                 :status.sync="status" :titleSize="40" bgColor="transparent" desc="" descColor="#999d9c" modalTop="0rpx"
                 padding="0" radius="30rpx" title="" titleColor="black" width="76vw">
            <view style="position: relative">
                <m-image :borderRadius="10"
