                    class="text-white"
                    open-type="share">
                    <view v-if="false" class="fa text-xl fa-android margin-right-xxl" style="height: 50rpx"></view>
                    分享
                </m-button>
            </view>
            <view style="background-color: transparent!important;position: relative">
                <image :mode="['aspectFit', 'scaleToFill', 'aspectFill', 'widthFix', 'heightFix'][3]"
                       :src="baseConfig.closeImg"
                       style="width: 76rpx;margin-top: 100rpx" @click="status=false"></image>
            </view>
        </m-modal>

        <m-modal :closeShow="false" :closeSize="40" :descSize="30" :maskClosable="true" :showContent="false"
                 :showTitle="false"
                 :status.sync="statusTwo" :titleSize="40" bgColor="transparent" desc="" descColor="#999d9c"
                 modalTop="0rpx"
                 padding="0" radius="30rpx" title="" titleColor="black" width="76vw">
            <view style="position: relative">
                <m-image :borderRadius="10"
                         :mode="['aspectFit', 'scaleToFill', 'aspectFill', 'widthFix', 'heightFix'][3]"
                         :shape="['square', 'circle'][0]" :showLoading="false"
                         :src="baseConfig.jumpImg"
                         bgColor="rgba(0, 0, 0, 1)" bgColorError="rgba(0, 0, 0, 1)" duration="0">
                    <view slot="error" class="text-white"
                          style="font-size: 24rpx;position: absolute;top: 0;left: 0">加载失败
                    </view>
                </m-image>
                <m-button :customStyle="{position: 'absolute',bottom: '40rpx',left: '10%',width: '80%', height: '96rpx',fontSize: '18px', background: 'linear-gradient(270deg, #FF7632 0%, #FF4343 100%)',
textShadow: '0px 1px 4px rgba(107, 21, 0, 0.39)',
boxShadow: '0px 2px 8px 0px rgba(255, 96, 57, 0.57), 0px 1px 4px 0px rgba(255, 255, 255, 0.54)'}" :disabled="false"
                          :hairLine="true" :loading="false" :plain="false"
                          :ripple="true"
                          :shape="['square', 'circle'][1]" :size="['default', 'medium', 'mini'][1]"
                          :type="['default', 'primary', 'error', 'warning', 'success'][1]"
                          class="text-white" @click="goVideoApplets">
                    <view v-if="false" class="fa text-xl fa-android margin-right-xxl" style="height: 50rpx"></view>
                    去试试效果吧
                </m-button>
            </view>
            <view style="background-color: transparent!important;position: relative">
                <image :mode="['aspectFit', 'scaleToFill', 'aspectFill', 'widthFix', 'heightFix'][3]"
