                       style="width: 76rpx;margin-top: 100rpx" @click="statusTwo=false"></image>
            </view>
        </m-modal>
    </view>
</template>

<script lang="ts">
import { Component, Vue } from 'vue-property-decorator'
import { State } from 'vuex-class'
@Component({})
export default class extends Vue {
    baseConfig: any = {
        baseSrc: 'https://6d69-miofly-k1xjk-1303051262.tcb.qcloud.la/images/glnz/1.jpg',
        sonicSrc: 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/shengbo@2x.png',
        cleanImg: 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/laba@2x.png',
        cleanGif: 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/qingli1.gif',
        cheatsImg: 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/miji@2x.png',
        shareImg: 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/fengxiang@2x.png',
        jumpImg: 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/tzxcx.png',
        closeImg: 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/close.png',
    }

    isPlay: boolean = false
    isPlayEnd: boolean = false
    adNoEnd: boolean = false
    schedule: any = 90
    promptText: string = '观看视频，清理灰尘'
    videoAd: any = null
    rewardedVideoAd: any = null
    interstitialAd: any = null
    clean_num: number = 0
    status: boolean = false
    statusTwo: boolean = false
    timeLength: number = 1000
    chatterTimer: any = null
    chatterTimerNum: number = 400

    allTimerStatus: boolean = true
    subTimerStatus: boolean = true


    @State('spgg', { namespace: 'root' }) spgg
    @State('ptgg', { namespace: 'root' }) ptgg
    @State('cpgg', { namespace: 'root' }) cpgg
    @State('ggkz', { namespace: 'root' }) ggkz


    onShareAppMessage (res) {
        if (res.from === 'button') {
            this.status = false
            if (this.clean_num > 0) {
                this.statusTwo = true
            }
        }
        return {
            title: '让你的手机一尘不染！',
            imageUrl: 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/poster.png',
            path: 'pages/index/index',
        }
    }


    onLoad (e) {
        wx.showShareMenu({
            // 只有拥有 shareTicket 才能拿到群信息，用户每次转发都会生成对应唯一的shareTicket 。
            withShareTicket: true,
            menus: ['shareAppMessage', 'shareTimeline']
        })

        this.rewardedVideoAd = null
        if (wx.createInterstitialAd) {
            this.rewardedVideoAd = wx.createRewardedVideoAd({
                adUnitId: this.$store.state.root.jlgg
            })
            this.rewardedVideoAd.onLoad(() => {
                console.log('激励广告加载成功')
            })
            this.rewardedVideoAd.onError((err) => {
                console.log('激励广告出错', err)
            })
            this.rewardedVideoAd.onClose((res) => {
                console.log(res, '用户关闭广告')
                // 用户点击了【关闭广告】按钮
                if (res && res.isEnded) {
                    // 正常播放结束，可以下发游戏奖励
                    this.realPlay()
                } else {
                    // 播放中途退出，不下发游戏奖励
                    // this.realPlay()
                    this.adNoEnd = true
                    // this.schedule = '未清理'
                    this.$mio.mioRoot.showToast('还未看完视频，无法清理..')
                }
            })
        }

        // this.interstitialAd = null
        // if (wx.createInterstitialAd) {
        // 	this.interstitialAd = wx.createInterstitialAd({
        // 		adUnitId: 'adunit-2d05b89d262a6943'
        // 	})
        // 	this.interstitialAd.onLoad(() => {
        // 		console.log('插屏广告加载成功')
        // 	})
        // 	this.interstitialAd.onError((err) => {
        // 		console.log('插屏广告加载出错', err)
        // 	})
        // 	this.interstitialAd.onClose(() => {
        // 		console.log('插屏广告关闭')
        // 	})
        // }

    }

    onUnload () {
        clearInterval(this.chatterTimer)
    }

    onHide () {
        this.allTimerStatus = false
        this.subTimerStatus = false
    }

    onShow (e) {
        this.allTimerStatus = true
        this.subTimerStatus = true
    }

    playAudio () {
        if (this.isPlayEnd) {
            this.isPlay = false
        }
        if (!this.isPlay) {
            // this.$mio.mioRoot.showToast('正在拉取视频..')
            // 用户触发广告后，显示激励视频广告
            this.rewardedVideoAd.show().catch(() => {
                // 失败重试
                this.rewardedVideoAd.load()
                    .then(() => this.rewardedVideoAd.show())
                    .catch(err => {
                        console.log(err)
                        console.log(this.isPlay)
                        if (!this.isPlay) {
                            this.realPlay()
                        }
                    })
            })
        }
    }

    goVideoApplets () {
        wx.navigateToMiniProgram({
            appId: 'wxb5a8f9db7585d767',
            path: '/pages/index/index',
            extraData: {},
            success: res => {
                console.log(res)
            },
            fail: err => {
                console.log(err)
            }
        })
    }

    realPlay () {
        this.clean_num++
        this.promptText = '开始清理'
        const innerAudioContext = uni.createInnerAudioContext()
        innerAudioContext.autoplay = true
        innerAudioContext.volume = 1
        innerAudioContext.obeyMuteSwitch = false
        innerAudioContext.src = 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/voice.mp3'
        uni.setInnerAudioOption({
            obeyMuteSwitch: false
        })
        this.isPlay = true
        this.schedule = 0
        this.isPlayEnd = false
        this.chatterTimer = setInterval(() => {
            if (this.subTimerStatus) {
                wx.vibrateLong()
            }
        }, this.chatterTimerNum)
        const timer = setInterval(() => {
            if (this.allTimerStatus) {
                this.promptText = `正在清理 ${this.schedule}%`
                this.schedule += 10
                if (this.schedule == 100) {
                    setTimeout(() => {
                        this.promptText = '清理完成'
                        if (this.clean_num == 1) {
                            this.$mio.mioRoot.showToast('清理完成，可继续深度清理', 'none', 2000)
                        }
                        this.isPlayEnd = true
                        clearInterval(timer)
                        clearInterval(this.chatterTimer)
                        innerAudioContext.pause()
                        innerAudioContext.destroy()
                        this.timeLength = 1200
                        this.chatterTimerNum = 300
                    }, 1000)
                    setTimeout(() => {
                        if (this.clean_num == 1) {
                            this.promptText = '观看视频，深度清理'
                        } else {
                            this.promptText = '观看视频，开始清理'
                        }

                        if (this.clean_num == 2) {
                            this.status = true
                        }
                    }, 2000)
                    setTimeout(() => {
                        this.baseConfig.cleanGif = 'https://e-static.oss-cn-shanghai.aliyuncs.com/img/wfd/xcx_bak/qingli2.gif'
                    }, 3000)
                }
            }

        }, this.timeLength)

        innerAudioContext.onPlay(() => {
            console.log('开始播放')
        })
        innerAudioContext.onError((res) => {
            console.log(res.errMsg)
            console.log(res.errCode)
        })
    }
}
</script>

<style>
page {
    background: rgb(1, 19, 103);
}

.newShake {
    animation: shake 0.3s linear 0s infinite alternate;
}

.newShakeOne {
    animation: newShakes 10s linear 0s infinite alternate;
}

@keyframes newShakes {
    0% {
        transform: translateX(-1000px)
    }
    /*25% {*/
    /*	transform: translateX(-100px)*/
    /*}*/
    50% {
        transform: translateX(-500px)
    }
    /*75% {*/
    /*	transform: translateX(100px)*/
    /*}*/
    100% {
        transform: translateX(0px)
    }
}

@keyframes shake {
    0% {
        transform: translateX(-18px)
    }
    50% {
        transform: translateX(0px)
    }
    100% {
        transform: translateX(18px)
    }
}

@keyframes warn {
    0% {
        transform: scale(1);
        opacity: 0;
    }
    25% {
        transform: scale(1.1);
        opacity: 0.5;
    }
    50% {
        transform: scale(1.2);
        opacity: 1;
    }
    75% {
        transform: scale(1.1);
        opacity: 0.5;
    }
    100% {
        transform: scale(1);
        opacity: 0.0;
    }
}


/* 产生动画（向外扩散变大）的圆圈*/
.pulse {
    animation: warn 1s ease-out;
    animation-iteration-count: infinite;
}

.box {
    background-image: url('data:image/png;base64,')
}
</style>
